INSERT INTO `newsmanagement` (`id`, `title`, `description`, `content`, `publish`, `created_at`, `updated_at`) VALUES
(9, 'What you need to know about PreBit?', 'PreBit  A Revolutionary Way To Get Help When You Need It', '<p>PreBit is a community where members help other members. Please know PreBit is not a bank, online business opportunity, HYIP, or investment program. It is simply a &ldquo;help and get helped&rdquo; system that connects those who need help with those who are ready and able to provide it.</p>\r\n\r\n<p>As a member of the PreBit community you will be able to earn up to 1% per day in interest, or up to 30% per month in interest, on every deposit you make.&nbsp; The system is set up in a way that people from all over the world can participate. It uses the Bitcoin, which is a decentralized currency that can be used by anyone&mdash; no matter what part of the world they live in.</p>\r\n\r\n<p>In the PreBit system there are no lenders and no borrowers. There are no contracts that need to be signed and no property to has to be pledged. It is a simple system built on generosity and reciprocity. It&rsquo;s all about providing goodwill to fellow human beings. One member asks for help and other members respond by making donations.&nbsp; After you have helped someone else, you will then be able to ask for help in your time of need. That&rsquo;s the beauty of the system. It&rsquo;s a community where everyone helps each other.</p>\r\n\r\n<p>Besides being able to earn a daily or monthly interest rate, you will also be able to earn a manger bonus of up to 10% daily, and a referral bonus of up to 10%. Please note for the referral bonus certain requirements must be met before you will receive the bonus.</p>\r\n\r\n<p>Other Great Features Include:</p>\r\n\r\n<ul>\r\n	<li>The Ability To Withdraw Your Profit Anytime You Want. No Token Required.</li>\r\n	<li>The Ability To Use Bitcoin Which Is a Global Currency.</li>\r\n	<li>Private Transactions</li>\r\n	<li>Secure Bitcoin Wallet Integration</li>\r\n	<li>Verified Members for Safety</li>\r\n	<li>A Smart Algorithm That Optimizes The Distribution Of Financial Aid</li>\r\n	<li>A Smart Algorithm That Ensures The System Is Fair and Transparent</li>\r\n</ul>\r\n\r\n<p>As a member of the PreBit community you are asked to do two very important things&mdash;to be honest and to be kind. Only ask for help when you need it, and be willing to help others when they need it. PreBit is committed to making the world a better place by offering a platform that allows anyone in the world to get the help they need when they need it the most. This platform gives people everywhere a chance to share their wealth and live a better life.</p>\r\n\r\n<p>PreBit is literally changing the way the world gets help. It&rsquo;s an amazing opportunity that everyone should want to be a part of. Not only will you be helping someone in need, but you will also be earning a profit in the process. It doesn&rsquo;t get any better than that!</p>\r\n\r\n<p>If you are ready to be a part of something that will change the world, join the PreBit community today. Help someone today, and someone will turn around and help you tomorrow!</p>\r\n', 2, 1490157589, 1493793495),
(10, 'What is Bitcoin?', 'Bitcoin is a form of digital currency, created and held electronically. ', '<p>Bitcoin is a form of digital currency, created and held electronically. No one controls it. Bitcoins aren&rsquo;t printed, like dollars or euros &ndash; they&rsquo;re produced by people, and increasingly businesses, running computers all around the world, using software that solves mathematical problems.</p>\r\n\r\n<p>It&rsquo;s the first example of a growing category of money known as cryptocurrency.</p>\r\n\r\n<h4><strong>What makes it different from normal currencies?</strong></h4>\r\n\r\n<p>Bitcoin can be used to buy things electronically. In that sense, it&rsquo;s like conventional dollars, euros, or yen, which are also traded digitally.</p>\r\n\r\n<p>However, bitcoin&rsquo;s most important characteristic, and the thing that makes it different to conventional money, is that it is <em>decentralized</em>. No single institution controls the bitcoin network. This puts some people at ease, because it means that a large bank can&rsquo;t control their money.</p>\r\n\r\n<h4><strong>Who created it?</strong></h4>\r\n\r\n<p>A software developer called Satoshi Nakamoto proposed bitcoin, which was an electronic payment system based on mathematical proof. The idea was to produce a currency independent of any central authority, transferable electronically, more or less instantly, with very low transaction fees.</p>\r\n\r\n<h4><strong>Who prints it?</strong></h4>\r\n\r\n<p>No one. This currency isn&rsquo;t physically printed in the shadows by a central bank, unaccountable to the population, and making its own rules. Those banks can simply produce more money to cover the national debt, thus devaluing their currency.</p>\r\n\r\n<p>Instead, bitcoin is created digitally, by a community of people that anyone can join. Bitcoins are &lsquo;mined&rsquo;, using computing power in a distributed network.</p>\r\n\r\n<p>This network also processes transactions made with the virtual currency, effectively making bitcoin its own payment network.</p>\r\n\r\n<h4><strong>So you can&rsquo;t churn out unlimited bitcoins?</strong></h4>\r\n\r\n<p>That&rsquo;s right. The bitcoin protocol &ndash; the rules that make bitcoin work &ndash; say that only 21 million bitcoins can ever be created by miners. However, these coins can be divided into smaller parts (the smallest divisible amount is one hundred millionth of a bitcoin and is called a &lsquo;Satoshi&rsquo;, after the founder of bitcoin).</p>\r\n\r\n<h4><strong>What is bitcoin based on?</strong></h4>\r\n\r\n<p>Conventional currency has been based on gold or silver. Theoretically, you knew that if you handed over a dollar at the bank, you could get some gold back (although this didn&rsquo;t actually work in practice). But bitcoin isn&rsquo;t based on gold; it&rsquo;s based on mathematics.</p>\r\n\r\n<p>Around the world, people are using software programs that follow a mathematical formula to produce bitcoins. The mathematical formula is freely available, so that anyone can check it.</p>\r\n\r\n<p>The software is also open source, meaning that anyone can look at it to make sure that it does what it is supposed to.</p>\r\n\r\n<h4><strong>What are its characteristics?</strong></h4>\r\n\r\n<p>Bitcoin has several important features that set it apart from government-backed currencies.</p>\r\n\r\n<p><strong>1. It&rsquo;s decentralized</strong></p>\r\n\r\n<p>The bitcoin network isn&rsquo;t controlled by one central authority. Every machine that mines bitcoin and processes transactions makes up a part of the network, and the machines work together. That means that, in theory, one central authority can&rsquo;t tinker with monetary policy and cause a meltdown &ndash; or simply decide to take people&rsquo;s bitcoins away from them, as the Central European Bank decided to do in Cyprus in early 2013. And if some part of the network goes offline for some reason, the money keeps on flowing.</p>\r\n\r\n<p><strong>2. It&rsquo;s easy to set up</strong></p>\r\n\r\n<p>Conventional banks make you jump through hoops simply to open a bank account. Setting up merchant accounts for payment is another Kafkaesque task, beset by bureaucracy. However, you can set up a bitcoin address in seconds, no questions asked, and with no fees payable.</p>\r\n\r\n<p><strong>3. It&rsquo;s anonymous</strong></p>\r\n\r\n<p>Well, kind of. Users can hold multiple bitcoin addresses, and they aren&rsquo;t linked to names, addresses, or other personally identifying information. However&hellip;</p>\r\n\r\n<p><strong>4. It&rsquo;s completely transparent</strong></p>\r\n\r\n<p>&hellip;bitcoin stores details of every single transaction that ever happened in the network in a huge version of a general ledger, called the <strong>blockchain</strong>. The blockchain tells all.</p>\r\n\r\n<p>If you have a publicly used bitcoin address, anyone can tell how many bitcoins are stored at that address. They just don&rsquo;t know that it&rsquo;s yours.</p>\r\n\r\n<p>There are measures that people can take to make their activities more opaque on the bitcoin network, though, such as not using the same bitcoin addresses consistently, and not transferring lots of bitcoin to a single address.</p>\r\n\r\n<p><strong>5. Transaction fees are miniscule</strong></p>\r\n\r\n<p>Your bank may charge you a &pound;10 fee for international transfers. Bitcoin doesn&rsquo;t.</p>\r\n\r\n<p><strong>6. It&rsquo;s fast</strong></p>\r\n\r\n<p>You can send money anywhere and it will arrive minutes later, as soon as the bitcoin network processes the payment.</p>\r\n\r\n<p><strong>7. It&rsquo;s non-repudiable</strong></p>\r\n\r\n<p>When your bitcoins are sent, there&rsquo;s no getting them back, unless the recipient returns them to you. They&rsquo;re gone forever.</p>\r\n\r\n<p>So, bitcoin has a lot going for it, in theory. But how does it work, in practice? Read more to find out how bitcoins are mined, what happens when a bitcoin transaction occurs, and how the network keeps track of everything.</p>\r\n', 2, 1490157657, 1493793495),
(11, 'Frequently asked questions (FAQ)', 'Frequently asked questions (FAQ)', '<p><span style=\"font-size:14px\"><strong>How do I invest on PreBit?</strong></span></p>\r\n\r\n<p>Please first download PreBit introduction <a href=\"http://pre-bit.org/readme.pdf\" target=\"_blank\">here</a> and <a href=\"http://pre-bit.org/instruction.pdf\" target=\"_blank\">here</a> for the instruction. They are extremely important for you to get started.&nbsp;</p>\r\n\r\n<p>Within the PreBit community, we say &ldquo;Send Help&rdquo; instead of invest. After adding funds to your Bitcoin wallet on PreBit (we call it PreBit wallet), click on Send Help menu and put an amount you are willing to give to the community. Please note that if you have not invested yet, you can take the money out of your PreBit wallet whenever your want.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>Will PreBit return my Capital/Principal?</strong></span></p>\r\n\r\n<p>Yes you will be able to get your capital back provided your investment has reached maturity. Depending on the amount you invest, you can withdraw your capital plus all interest accrued in 25 &ndash; 180 days. You can also keep your investment (SH) active to earn more interest. You can withdraw your interest whenever you want.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>What are Tokens used for?</strong></span></p>\r\n\r\n<p>Tokens work like transaction fees and they are needed when you Invest/Withdraw. Each time you Invest or Withdraw, tokens will be deducted from your Token Balance. The number of tokens needed are based on the amount you Invest/Withdraw. You will need to buy some Tokens before you Send Help. Take a look at the table below for more details:</p>\r\n\r\n<table class=\"no-margin table table-striped\" style=\"height:191px; width:781px\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:left\">Investment Amount</th>\r\n			<th style=\"text-align:left\">Token Needed</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:left\">0.05 BTC &ndash; 2.0 BTC</td>\r\n			<td style=\"text-align:left\">1 Token</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">2.x BTC &ndash; 4.0 BTC</td>\r\n			<td>2 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">4.x BTC &ndash; 6.0 BTC</td>\r\n			<td>3 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">6.x BTC &ndash; 8.0 BTC</td>\r\n			<td style=\"text-align:left\">4 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">8.x BTC &ndash; 12.0 BTC</td>\r\n			<td style=\"text-align:left\">5 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">12.x BTC &ndash; 15.0 BTC</td>\r\n			<td style=\"text-align:left\">6 Tokens</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table class=\"no-margin table table-striped\" style=\"height:191px; width:781px\">\r\n	<thead>\r\n		<tr>\r\n			<th style=\"text-align:left\">Withdrawal Amount</th>\r\n			<th style=\"text-align:left\">Token Needed</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:left\">1 BTC &ndash; 3.0 BTC</td>\r\n			<td style=\"text-align:left\">1 Token</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">3.x BTC &ndash; 6.0 BTC</td>\r\n			<td>2 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">6.x BTC &ndash; 9.0 BTC</td>\r\n			<td>3 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">9.x BTC &ndash; 12.0 BTC</td>\r\n			<td style=\"text-align:left\">4 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">12.x BTC &ndash; 20.0 BTC</td>\r\n			<td style=\"text-align:left\">5 Tokens</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:left\">20.x BTC &ndash; 30.0 BTC</td>\r\n			<td style=\"text-align:left\">6 Tokens</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><strong>How can I withdraw my earnings?&nbsp;</strong></span></p>\r\n\r\n<p>Depending on the amount you SH, you can withdraw your earnings including your capital in 25 &ndash; 120 days. To withdraw your funds, go to Send Help menu and click on Withdraw Profit + Capital, then go to Get Help menu to send the funds to your PreBit wallet. From PreBit wallet, you can send the money to a Bitcoin address of your choice. Withdrawal request is processed instantly. Please note that if your deposit has not reached maturity, you can only withdraw your profits.</p>\r\n', 2, 1490157840, 1493793496),
(12, 'Important notice regarding your name when registering', 'It is required to enter your real name when making a PreBit account.', '<p>Dear all PreBit members,</p>\r\n\r\n<p>It is required to enter your real name when making a PreBit account. If you are still using any other name rather than your real name, please admend it ASAP as PreBit will soon ask all members to verify their accounts before making withdrawals.</p>\r\n\r\n<p>Thank you and best regards,</p>\r\n\r\n<p>PreBit Team</p>\r\n', 2, 1490157943, 1493793496),
(13, 'User Notification', 'User notification on Dashboard', '<p>Due to Bitcoin&rsquo;s price rise fluctuation, PreBit&rsquo;s current primary activity is trading on Bitcoin/altcoins</p>\r\n\r\n<p>Therefore, this week&rsquo; interest will be applied as follows:</p>\r\n\r\n<p>Basic: 0.35% Advanced: 0.6% Premier: 0.65% Ultimate: 0.7%</p>\r\n', 1, 1493353148, 1493793511);
