(243, 242, 0, 300, 'Wrong topic description', '<p>Hi,</p>\r\n\r\n<p>We noticed that you opened a topoic here http://www.dreamteammoney.com/index.php?showtopic=284363</p>\r\n\r\n<p>Your discription is kinda wrong. Can you please change it to this:</p>\r\n\r\n<p>Bitway is a community of likeminded individuals who take control of their financial freedom and help others do the same. At Bitway, you will earn a minimum of 1% interest daily (up to 1.5%) on money that you put into the community. Bitway gives you the perfect opportunity to maximize your passive income. Take advantage of the following features:</p>\r\n\r\n<p>- Earn 1% - 1.5% interest daily</p>\r\n\r\n<p>- Referral bonuses up to 10%</p>\r\n\r\n<p>- Manager bonuses up to 10.5%</p>\r\n\r\n<p>- Make withdrawals whenever you want. All payments are INSTANTLY processed</p>\r\n\r\n<p>- Secure Bitcoin wallet integration and private transactions</p>\r\n\r\n<p>- Access to a global network of investors</p>\r\n\r\n<p>Plan:</p>\r\n\r\n<p>0.05 - 1 BTC - 1% daily for 25 days - 180 days. Principal return.</p>\r\n\r\n<p>1.01 - 3 BTC - Up to 1.1% daily for 30 days - 180 days. Principal return.</p>\r\n\r\n<p>3.01 - 6 BTC - Up to 1.2% daily for 45 days - 180 days. Principal return.&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>6.01 - 12 BTC - Up to 1.3% daily for 60 days - 180 days. Principal return.&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>12.01 - 20 BTC&nbsp;&nbsp; - Up to 1.4% daily for 90 days - 180 days. Principal return.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Over 20 BTC - Up to 1.5% daily for 120 days - 180 days. Principal return.&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1476584405, 1476584405),
