(289, 286, 0, 1581, 'change email', '<p>Your email has been changed.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1484761410, 1484761410),
(291, 289, 0, 1601, 'help', '<p>I will return the money to you shortly.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 1, 1, 1484807808, 1484807808),
(293, 289, 0, 1601, 'help', '<p>I have just sent you back $400 (~40 tokens). You will see the money in your wallet soon.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1484808733, 1484808733),
(295, 293, 0, 1537, 'account status Verification ', '<p>Your account will be verified in 1-5 hours.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1484814329, 1484814329),
(299, 297, 0, 1381, ' Does not get get total?', '<p>Hi,</p>\r\n\r\n<p>The daily profit will be increased according to the life-time of your SH. The longer&nbsp; you keep your SH active, the greater your daily profit is.</p>\r\n\r\n<p>Day 1 - Day 30: 1%</p>\r\n\r\n<p>Day 31 - Day 60: 1.1%</p>\r\n\r\n<p>Day 61 - Day 90: 1.2%</p>\r\n\r\n<p>Day 91 - Day 120: 1.3%</p>\r\n\r\n<p>Day 121 - Day 150: 1.4%</p>\r\n\r\n<p>Day 151 - Day 180: 1.5%</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485056645, 1485056645),
(300, 295, 0, 1619, '?????????', '<p>How can I help you?</p>\r\n', '', 1, 1, 1485056711, 1485056711),
(304, 302, 0, 1619, 'registration', '<p>How many accounts with same details that you want to register? It is not allowed to have multiple accounts on Bitway. However, since you are from Japan, I can make exception.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485071894, 1485071894),
(306, 302, 0, 1619, 'registration', '<p>Please write in English.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485081722, 1485081722),
(308, 306, 0, 1619, 'Thank Thank you for your reply! ', '<p>Yes you can have up to 3 accounts under same names if you are from Japan. You just need to let me know before doing so.</p>\r\n\r\n<p>Is it okay if my family name and phone number differ? - It&#39;s OK</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485096071, 1485096071),
(310, 306, 0, 1619, 'Thank Thank you for your reply! ', '<p>You can use same name, but different phone numbers. For example: phone numbers of your friends or family members.</p>\r\n\r\n<p>Maximum 3 accounts under same names.</p>\r\n\r\n<p>Thank you.</p>\r\n', '', 1, 0, 1485104713, 1485104713),
(312, 310, 0, 853, 'withdraw', '<p>Your account is now verified. Can you introduce other members to Bitway?</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485612072, 1485612072),
(314, 312, 0, 1717, 'I want change tokens to bitcoin.', '<p>How many tokens you want to keep? I will then refund the money to your Bitway wallet so that you can SH.<br />\r\n<br />\r\nThanks.</p>\r\n', '', 1, 1, 1485872216, 1485872216),
(316, 312, 0, 1717, 'I want change tokens to bitcoin.', '<p>Hi,</p>\r\n\r\n<p>$80 ~ 0.08 BTC has just been refunded. It will be credited to your Bitway wallet soon.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1485873010, 1485873010),
(318, 312, 0, 1717, 'I want change tokens to bitcoin.', '<p>Please introduce Bitway to other people.</p>\r\n\r\n<p>Thank you.</p>\r\n', '', 1, 1, 1485876859, 1485876859),
(345, 338, 0, 1893, 'help', '<p>I just credited <strong>0.993</strong>4 BTC back to your account. It will be on your Bitway wallet soon. After that you can make an SH.</p>\r\n\r\n<p>Thanks.</p>\r\n', '', 1, 1, 1487416109, 1487416109),
(363, 362, 1739, 0, 'Get help still remains pending ', '<p>I can not withrow my profit from account( it is still pending). Please explain when your bitway solve my problem. I wait for your answer.</p>\r\n\r\n<p>Mr. Nam</p>\r\n', '', 1, 1, 1488682769, 1488682769),
(364, 363, 773, 0, 'WHY!!!???', '<p>why can i use GH function???!!! tried&nbsp;5748593425 times</p>\r\n', '', 1, 0, 1488718256, 1488718256),
(365, 364, 1452, 0, 'withdraw pending', '<p>Dear Admin</p>\r\n\r\n<p>I withdraw 28.02.2017 pending, not pay?</p>\r\n\r\n<p>Please check it &amp; feedback me!</p>\r\n\r\n<p>Thanks so much!</p>\r\n', '', 1, 1, 1488869882, 1488869882),
(366, 365, 1903, 0, 'Withdrawal long pending', '<p>Sirs,</p>\r\n\r\n<p>My name is NGUYEN DUC SON</p>\r\n\r\n<p>My Username is NDSBW</p>\r\n\r\n<p>I have deposited from 18 Feb 2017 and have earned some small amount.</p>\r\n\r\n<p>I have reqested to withdraw the earning to my Bitcoin Wallet. The request has been recorded with PENDING status for very long time and until now it has not beed sent to my Bitcoin Wallet.</p>\r\n\r\n<p>I have also uploaded my passport, my local ID and my portrait but my ACCOUNT STATUS still not verified. Also my TELEPHONE NUMBER not verified although it had been provided at the beginning.</p>\r\n\r\n<p>So, please:</p>\r\n\r\n<p>1- Verify my profile documents and phone number</p>\r\n\r\n<p>2- Transfer my earning to my Bitcoin Wallet.</p>\r\n\r\n<p>Thank you for attention and settlemet.</p>\r\n\r\n<p>Best Regards</p>\r\n\r\n<p>NGUYEN DUC SON</p>\r\n', 'uploads/message/Withdrawallongpending365.doc', 1, 1, 1488935066, 1488935066),
(367, 366, 1814, 0, 'verifi account', '<p>How to verified&nbsp;my account?</p>\r\n', '', 1, 0, 1489402747, 1489402747),
